DROP TABLE IF EXISTS `wf_deployment`;
CREATE TABLE `wf_deployment`  (
  `id` bigint(20) NOT NULL COMMENT 'primary key',
  `model_id` bigint(20) NOT NULL COMMENT 'model id',
  `model_key` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'model key',
  `model_version` int(11) NOT NULL COMMENT 'model version',
  `deployment_id` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'flowable deployment id',
  `process_definition_id` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'process definition id',
  `process_definition_key` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'process definition key',
  `process_definition_name` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT 'process definition name',
  `form_json` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL COMMENT '动态表单JSON',
  `process_definition_version` int(11) NOT NULL COMMENT 'process definition version',
  `deploy_status` int(11) NOT NULL DEFAULT 1 COMMENT 'deploy status: 1-active,0-archived',
  `create_time` datetime NOT NULL COMMENT 'create time',
  `create_user` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT 'create user',
  `update_time` datetime NOT NULL COMMENT 'update time',
  `update_user` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT 'update user',
  `status` int(11) NOT NULL DEFAULT 1 COMMENT 'record status',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_model_key`(`model_key` ASC) USING BTREE,
  INDEX `idx_process_definition_id`(`process_definition_id` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci COMMENT = 'flowable deployment' ROW_FORMAT = DYNAMIC;

