-- ----------------------------
-- Table structure for wf_model
-- ----------------------------
DROP TABLE IF EXISTS `wf_model`;
CREATE TABLE `wf_model`  (
  `id` bigint(20) NOT NULL COMMENT 'primary key',
  `model_key` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'model key',
  `model_name` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'model name',
  `category` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT 'category',
  `version` int(11) NOT NULL DEFAULT 1 COMMENT 'model version',
  `model_status` int(11) NOT NULL DEFAULT 0 COMMENT 'model status: 0-draft,1-released,2-archived',
  `end_time` datetime NOT NULL DEFAULT '2099-01-01 00:00:00' COMMENT 'model end time (workflow expiry)',
  `bpmn_xml` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL COMMENT 'bpmn xml',
  `form_json` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL COMMENT '动态表单JSON',
  `node_actions_json` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL COMMENT 'node actions json',
  `remark` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT 'remark',
  `create_time` datetime NOT NULL COMMENT 'create time',
  `create_user` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT 'create user',
  `update_time` datetime NOT NULL COMMENT 'update time',
  `update_user` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT 'update user',
  `status` int(11) NOT NULL DEFAULT 1 COMMENT 'record status',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `uk_model_key_version`(`model_key` ASC, `version` ASC) USING BTREE,
  INDEX `idx_model_key`(`model_key` ASC) USING BTREE,
  INDEX `idx_model_status`(`model_status` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci COMMENT = 'flowable model' ROW_FORMAT = DYNAMIC;

